import Helmet from "react-helmet";

export default class About extends Component {
  render() {
    const style = {
      height: "500px"
    };
    return (
      <div>
        <div className="card">
          <Helmet bodyAttributes={{ style: "background-color: black" }} />
        </div>
      </div>
    );
  }
}
